import { LogoImg } from "../locales/images/logo";
import { pl } from "../locales/languages/pl";
import { Button, LoginButton } from "../styles/Buttons";
import { Constants } from "../styles/Constants";
import { HeaderBox, LoginBox, LogoBox, TitleTxt } from "../styles/Header";
import {
  MainTitleText,
  IrishText,
  SerifTextS,
  SerifText,
} from "../styles/TextStyles";
import { Search } from "./Search";

export const Header = ({ filter, setFilter }: any) => {
  return (
    <HeaderBox>
      <Search filter={filter} setFilter={setFilter}></Search>
      <LogoBox>
        <LogoImg />
      </LogoBox>
      <TitleTxt>
        <MainTitleText>{pl.title}</MainTitleText>
      </TitleTxt>
      <LoginBox>
        <LoginButton>
          <SerifText style={{ userSelect: "none" }}>
            {pl.header.login}
          </SerifText>
        </LoginButton>
        <LoginButton>
          <SerifText style={{ userSelect: "none" }}>{pl.header.list}</SerifText>
        </LoginButton>
      </LoginBox>
    </HeaderBox>
  );
};
